import MyPosts from "./MyPosts/MyPosts";
import ProfileInfo from "./ProfileInfo/ProfileInfo";
import "./Profile.css";

const Profile = () => {
  let posts = [
    {
      id: 1,
      message: "My first post",
      likesCount: 15,
    },

    {
      id: 2,
      message: "My second post",
      likesCount: 12,
    },
    {
      id: 3,
      message: "My third post",
      likesCount: 17,
    },
    {
      id: 4,
      message: "My fourth post",
      likesCount: 14,
    },
  ];
  return (
    <div>
      <ProfileInfo />
      <MyPosts posts={posts} />
    </div>
  );
};

export default Profile;
